css:
@namespace url(http://www.w3.org/1999/xhtml);

@-moz-document domain("nodejs.org") {
    body {
        color: #839496;
        background-color: #002b36;
    }
    h1, h2, h3, h4, h5 {
        color: #b58900;
    }
    a, a:link,
    #column2 ul li a {
        color: #268bd2;
    }
    a:hover, a:focus {
        color: #002b36;
        background-color: #268bd2;
    }
    #column2.interior,
    #column2 ul {
        background-color: #073642;
    }
    #column2 ul li a.active,
    #column2 ul li a.active:hover,
    #column2 ul li a.active:focus {
        color: #859900;
    }
    #toc .stability_0::after {
        background-color: #dc322f;
        color: #eee8d5;
    }
    .api_stability_2 {
        background-color: #859900;
    }
    tt, code {
        color: #93a1a1;
        background-color: #073642;
    }
    pre {
        background-color: #073642;
        border-radius: 5px;
    }
    .sh_sourceCode .sh_keyword {
        color: #859900;
    }
    .sh_sourceCode .sh_function {
        color: #268bd2;
    }
    .sh_sourceCode .sh_symbol,
    .sh_sourceCode .sh_cbracket {
        color: #93a1a1;
    }
    .sh_sourceCode .sh_string,
    .sh_sourceCode .sh_regexp,
    .sh_sourceCode .sh_number,
    .sh_sourceCode .sh_specialchar {
        color: #dc322f;
    }
    .sh_sourceCode .sh_comment {
        color: #2aa198;
    }
}
